import React, { useState } from "react";

const Login = () => {
  const [values, setValues] = useState([
    {
      name: "email"
    },
    {
      name: "password"
    }
  ]);

  return (
    <div className="app">
      <form>
        <div className="form-inner">
          {values.map((item) => (
            <div key={item.name}>
              <div>
                <input
                  className="form-input"
                  type={item.name}
                  name={item.name}
                  placeholder={item.name}
                />
              </div>
            </div>
          ))}
          <button>SIGN IN</button>
        </div>
      </form>
    </div>
  );
};

export default Login;
